import React from 'react';
import bg19 from '../img/bg19.jpg';
import '../styles/voluntario.css';
import { FacebookOutlined, TwitterCircleFilled,InstagramFilled } from '@ant-design/icons';
import 'antd/dist/antd.css';
import { Input } from 'antd';

const { TextArea } = Input;


export default function Voluntario() {
 return (
   <div className="ffullpage" style={{ backgroundImage: `url(${bg19})` }}>
     <div className="join"><h1>Torne-se um voluntario.</h1></div>       
       <div className="vfull">
         <h1>Faça parte do nosso time.</h1> 
         <div className="cadv">
           <p>Nome:</p>
         <Input placeholder="Digite seu nome" />
         <p>E-mail</p>
         <Input placeholder="E-mail" />
         <p>Telefone</p>
         <Input placeholder="Telefone" />
         <p>Endereço</p>
         <Input placeholder="Enderço" />
         <p>Idade</p>
         <Input placeholder="Idade" />

        </div>        
      </div><div className="footer"><h5>© Copyright 2022 Projeto Visão Social - All Rights Reserved</h5></div>
      

   </div>
 );
}
